import React, { Component } from 'react'

class navbar extends Component {
    render() {
        return (
            <div className="navbar">
                <h2 className="logo">OA</h2>
                <ul>
                    <li>Home</li>
                    <li>About Me</li>
                    <li>Interest Area</li>
                    <li>Home</li>
                </ul>
            </div>
        )
    }
}

export default navbar;
